import { MovieCard } from '../components/main/MovieCard';

export function Home() {
    const [movies, setMovies] = useState([]);
    useEffect(() => {
        fetch("https://localhost:7121/api/movies/")
            .then(response => response.json())
            .then(data => {
                setMovies(data);
            })
    }, [movies])
    
    return (
        <div>
    <MovieCard/>
        </div>
    )
}
